export default function Navbar({ setPage }) {
  return (
    <nav>
      <button onClick={() => setPage("home")}>Home</button>
      <button onClick={() => setPage("chat")}>Health</button>
      <button onClick={() => setPage("nearby")}>Nearby</button>
      <button onClick={() => setPage("emergency")}>Emergency</button>
      <button onClick={() => setPage("letter")}>Letter</button>
      <button onClick={() => setPage("feedback")}>Feedback</button>
      <button onClick={logout}>Logout</button>
    </nav>
  );
}
